import {CREATE_DATA} from "../types"

const initialState ={
    flag: false,
    stateData: {
                uid: '',
                name: "",
                projectName: "",
                isTemplate: ""
            },
    nameWindow: "q",
    labels: [
                'uid',
                'Наименование',
                'projectName',
                'isTemplate'
            ],
    placeholders: [
                'uid',
                'Введите полное наименование',
                'projectName',
                'isTemplate'
            ],
    typeData: [
                "text",
                "text",
                "text",
                "text"
            ]
                    };

const WindowCreateData_EltypeClass = (state = initialState, action) => {
    
    switch (action.type){
            
        case CREATE_DATA:
            return {
                ...state,
                stateData: action.payload
            }

        default: 
            return state;
    }
}
export default WindowCreateData_EltypeClass
